import React from 'react';
import {baseURL} from '../services/OpenAI';
import axios from 'axios';

class PetNamesResultComponent extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            urlBase: baseURL,
            response: {
                names: [],
            },
        }
    }
    componentDidMount(){
        console.log(this.state.baseURL + "nlp-pet-name-fake/specie/" + this.props.specie);
        axios
         .post(this.state.baseURL + "nlp-pet-name-fake/specie/" + this.props.specie)
         .then((response) => {
            this.state.openAIresponse.names = response.data.names;
            // console.log(this.state.openAIresponse);
         })
         .catch((error) => {
            console.log(error);
         });
        return;
    }

    render(){
        const renderResponse = () => {
            if(this.state.response.names.length > 0){
                const res = (
                <ul>
                    <li>Specie: {this.state.specie}</li>
                </ul>
                );
                return res;
            }
            else
            {
                return <p>There are no names for this specie</p>
            }
        }
        return(
            <div className="result-pet-names">
                {renderResponse()}
            </div>
        )
    }
}

export default PetNamesResultComponent;
